class CategoryApiService {

  getAllCategories(): Promise<Array<Category>> {
    return new Promise((resolveInner) => {
      setTimeout(() => resolveInner(CATEGORIES), 500);
    });
  }

  getSubcategories(categoryId: string): Promise<Array<Subcategory>> {
    return new Promise((resolveInner) => {
      setTimeout(() => resolveInner(SUBCATEGORIES.get(categoryId)), 200);
    });
  }
}

export default CategoryApiService;